import React from 'react';
import Carousel from 'react-bootstrap/Carousel';
import Container from 'react-bootstrap/Container';
import rick1 from '../img/rick1.jpg';
import rick2 from '../img/rick2.jpg';
import rick3 from '../img/rick3.png';
import abobora from '../img/abobora.png';
import bastao from '../img/bastao.png';
import bola from '../img/bola-magica.png';
import '../App.css';


function Home() {
  return (
    <Container>
      <br />
      <Carousel>
        <Carousel.Item interval={1000}>
          <img
            className="d-block"
            src={rick1}
            alt="First slide"
            id='imgCarousel'
          />
        </Carousel.Item>
        <Carousel.Item interval={1000}>
          <img
            className="d-block"
            src={rick2}
            alt="Second slide"
            id='imgCarousel'
          />
        </Carousel.Item>
        <Carousel.Item Interval={1000}>
          <img
            className="d-block"
            src={rick3}
            alt="Third slide"
            id='imgCarousel'
          />
        </Carousel.Item>
      </Carousel>

      <br /><hr id='line' /><br />

      {/* linha de categorias */}
      <section id='categoriasLink'>
        <a href='/'> <img
          src={rick3}
          alt="categoria"
          id='imgButton'
        /></a>
        <a href='/'> <img
          src={rick3}
          alt="categoria"
          id='imgButton'
        /></a>
        <a href='/'> <img
          src={rick3}
          alt="categoria"
          id='imgButton'
        /></a>
        <a href='/'> <img
          src={rick3}
          alt="categoria"
          id='imgButton'
        /></a>
        <a href='/'> <img
          src={rick3}
          alt="categoria"
          id='imgButton'
        /></a>
      </section>
      <br />


    </Container>
  );
}


export default Home;
